  true,\n\t\"url\": null,\n\t\"notes\": \"The National Assessment of Educational Progress,
  2013 (NAEP 2013), is a study that is part of the National Assessment of Educational
  Progress (NAEP) program; program data is available since 1990 at http://nces.ed.gov/nationsreportcard/naepdata/.
  NAEP 2013 (http://nces.ed.gov/nationsreportcard/) is a cross-sectional survey that
  assesses what America's students know and can do in various subject areas. Students
  in grade 4, 8, and 12 were sampled. NAEP 2013 assessments consist of national and
  state assessments in mathematics and reading. Key statistics produced from the NAEP
  2013 are results on subject-matter achievement, instructional experiences, and school
  environment for populations of students (e.g., all fourth-graders) and groups within
  those populations (e.g., female students, Hispanic students).\",\n\t\"license_title\":
